#An event update function for the recording bar gui.
def recording_bar(event,window,i, duration):
    event, values = window.read(timeout=1)
    if event == sg.WIN_CLOSED:
        sys.exit()
    else:  
        window['RECORDING'].update_bar(i, duration)
